import React from 'react';

const Login = () => {
    return (
        <div className='login'>
            <h3>Login</h3>
            <form>
                <label for='username'>username:</label>
                <input type='text' id='username' name='username'></input>
            </form>
        </div>
    );
}

export default Login;
